import React, { Component } from 'react';
import { Layout, Header, Navigation, Drawer, Content } from 'react-mdl';
import Headroom from 'react-headroom';
import MediaQuery from 'react-responsive';
import logo from './assets/logo.svg';


class MobileNavigation extends Component{

    render() {
  return (
  		<MediaQuery className="mobileHeader" query="(max-device-width: 800px)">
        <Headroom>
          <div style={{height: '5600px', position: 'relative'}}>
              <Layout fixedHeader>
                  <Header className='subHeader'>
      <aside className='subHeader'>
      <img src={logo} className="App-logo" alt="logo" /><span className="App-logo-span">Douglas Coke
      </span></aside>
                  </Header>
                  <Drawer title="Title">
                      <Navigation>
                          <a href="#">Link</a>
                          <a href="#">Link</a>
                          <a href="#">Link</a>
                          <a href="#">Link</a>
                      </Navigation>
                  </Drawer>
                  <Content />
              </Layout>
          </div>
      </Headroom>
  	</MediaQuery>

    );
  }
}

export default MobileNavigation;
